"More is more!
A boomerang with more weight!
And a more obtuse angle!
. 
I‘m talking about the „Sport-Bumerang Comeback“ by Willi Urban, one of the trailblazers of our sport. 
. 
„Willi Urban promoted boomerang throwing in Germany from the 1950s through the 1980s. He published a mall booklet titled 'Geheimnisvoller Bumerang' in 1966.“
. 
„He also marketed a very large traditional boomerang which had sharp leading edges and had a flight range of more than 50 metres. This traditional was made out of Polyamide GFK plastic and is not the kind of boomerang that you would want to catch.“
https://www.flight-toys.com/boomerang/collectable/jb05.html
. 
And this is it!
In perfect condition. It‘s not „Like New“ It IS NEW! 
Plus the book! I only unpacked it from the original wrapping paper. You won’t believe it’s from 1966. (In case you want your personal issue, please check „Boomerang Bazaar“ on Facebook!)
. 
This 54-year old boomerang book shows the state of the art in European boomerangs of the 1960s. Incl. 19 illustrations by the author on 57 pages.
. 
The great pre-story of this boomerang is written in page 15f:
As a boy, Willi Urban learned about boomerangs from a book and had his uncle buy him his first boomerang for just more than 1 Mark. After WWII, Willi found boomerangs in a shop, bought them instantly and started tests.
. 
In 1957, Willi Urban first had contact to Frank Donnellan from Australia and started an intensive letter exchange that resulted in Frank sending Willi 4 personalized boomerangs. These started even more tests. Please check the pictures for examples of the shapes he tested and the test results. 
. 
All these experiments led to the development of a boomerang that was - in shape and material - much closer to the Donnellan boomerangs that to everything you could find in Europe at that time. 
. 
The 58 cm and 161 g „Comeback“ has influenced German boomerang throwers a lot! It was everywhere in toyshops until the 1980s.
I have bought my first one in the mid-1980s and used it often. 
. 
It was marketed as right-handed, but the sharp airfoil is really special - it looks like an airfoil for left-handed boomerangs. My friend Guido, a lefty, had to try it.";}i:82;a:1:{s:14:"comments_count";i:1;}i:83;a:1:{s:11:"likes_count";i:2;}i:84;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuqbb3i6df";}i:85;a:1:{s:5:"image";s:259:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118779525_686303065293192_4651556195036199469_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=wLjh2Smx15gAX--ZJoV&_nc_tp=15&oh=a91a369c05dbb82879ee2fda89ee4a68&oe=5F7BFCDC";}i:86;a:1:{s:4:"type";s:7:"sidecar";}i:87;a:1:{s:8:"owner_id";i:7736724849;}i:88;a:1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2391033398004419319";}i:92;a:1:{s:10:"short_code";s:11:"CEuqDUOJgr3";}i:93;a:1:{s:12:"created_time";i:1599253414;}i:94;a:1:{s:7:"caption";s:894:"💒💒💒

